import { useState } from 'react';
import './App.css';
import logo from './logo.svg';

function App() {
  const [count, setCount] = useState(0);

  function decrement() {
    setCount(count - 1);
  }

  function increment() {
    setCount(count + 1);
  }

  const buttonDiv = {
    background: 'blue',
    color: 'red',
    fontSize: '20px',
    borderRadius: '500px',
  };

  return (
    <div className='App'>
      <header className='App-header'>
        <div>
          <span>{count}</span>
          <button style={buttonDiv} onClick={decrement}>
            -
          </button>
          <button style={buttonDiv} onClick={increment}>
            +
          </button>
        </div>
        <img src={logo} className='App-logo' alt='logo' />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        <a
          className='App-link'
          href='https://reactjs.org'
          target='_blank'
          rel='noopener noreferrer'
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
